import React, { useEffect,  } from 'react'
import {Paper, TableContainer,Table,TableHead,TableRow, TableCell} from "@mui/material";

function MuiTable() {
  const colums = [
    {id:"id",name:"Id"},
    {id:"name",name:"Name"},
    {id:"email",name:"Email"},
    {id:"phone",name:"Phone"}
  ]

  const [rows, setRows] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8000/contacts')
    .then(resp => {
      return resp.json();
    })
      .then(resp =>{
        setRows(resp);
      }).catch(err =>{
        console.log(err.message);
      })
    },[])
  return (
    <div className='text-center'>
      <h1>MUI Table</h1>

    <Paper sx={{width:"90%", marginLeft:"5%"}}>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              {colums.map((col)=>{
                return <TableCell key={col.id}>{col.name}</TableCell>
              })}
            </TableRow>
          </TableHead>
        </Table>
      </TableContainer>
    </Paper>
    </div>
  )
}

export default MuiTable
